import React from 'react';
import { MDBRow, MDBCol, MDBInput, MDBTextArea, MDBBtn } from 'mdb-react-ui-kit';

export default function App() {
  return (
    <section className='border text-center mb-4'>
      <h3 className='mb-5'>Contact us</h3>
      <div className='row'>
        <div className='col-lg-5'>
          <iframe
            src='https://www.google.com/maps/place/SM+VITA/@19.1116761,72.832891,15z/data=!4m6!3m5!1s0x3be7c9c3a5e26d7b:0x89a89f343cff9c29!8m2!3d19.1116761!4d72.832891!16s%2Fg%2F1tfw1hpk?entry=ttu'
            className='h-100 w-100'
            style={{ border: '0' }}
            loading='lazy'
          ></iframe>
        </div>
      </div>
    </section>
  );
}
